	public static void send(String host, int port, String content){
		
		String cacheServer = host;
		int cacheServerPort = port;
		
		Socket s = null;
		OutputStream out = null;
		InputStream in = null;
		
		try{
			s = new Socket(cacheServer, cacheServerPort);
			out = s.getOutputStream();
			in = s.getInputStream();
			
			
			String tosend  = content;
			out.write(tosend.getBytes());
			out.flush();
			
			BufferedReader reader = new BufferedReader(new InputStreamReader(in, "UTF-8"));
			
			String stringin ="";
			
			String line = reader.readLine();
			
			
			while(line.length() != 0){
               stringin += line;
               line = reader.readLine();
            }
			
			System.out.println(stringin);
		}
		catch (Exception e){
			System.out.println(e);
			e.printStackTrace();
		}
	
	}
	
	
